import MainPage from "./MainPage";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import DetailView from "./DetailView";

function App() {
    return (
        <div className="App">
            <BrowserRouter>
                <Routes>
                    <Route path="/" element={<MainPage />}></Route>
                    <Route path="/detailview/*" element={<DetailView />}></Route>
                </Routes>
            </BrowserRouter>
        </div>
    );
}

export default App;
